import React from 'react';
import "bootstrap/dist/css/bootstrap.min.css"
import { BrowserRouter as Router, Route } from "react-router-dom";
import './App.css';

import Navbar from "./components/navbar.component";
import CreateAttendance from "./components/create-attendance.component";
import EditStudentAttendance from "./components/edit-student-attendance.component";
import CheckStudentAttendance from "./components/check-student-attendance.component";

function App() {
  return (
    <Router>
      <div className="container">
        <Navbar />
        <br/>
        <Route path="/" exact component={CreateAttendance} />
        <Route path="/" component={EditStudentAttendance} />
        <Route path="/" component={CheckStudentAttendance} />
      </div>
    </Router>
  );
}

export default App;
